import React from 'react'
import { Link } from 'react-router-dom'

const NavBar = () => {
  return (
    <nav>
      <Link to="/Movies">Movies</Link>
      <Link to="/Customers">Customers</Link>
    </nav>
  )
}

export default NavBar
